import React, { useState } from 'react';
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  TextField,
  Box,
  Typography,
  Avatar,
  IconButton,
  Stack
} from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';
import SendIcon from '@mui/icons-material/Send';
import axios from 'axios';

export default function ChatModal({ open, onClose, clinica }) {
  const [mensagem, setMensagem] = useState('');

  const handleEnviarMensagem = async () => {
    try {
      await axios.post('http://192.168.0.27:5000/api/mensagens', {
        clinicaId: clinica._id || clinica.id,
        remetente: 'paciente',
        texto: mensagem || `Olá, gostaria de agendar uma consulta para ${clinica?.especialidade}. Por favor, me informe os horários disponíveis e valores.`
      });
      setMensagem('');
      onClose();
      // Aqui você pode exibir um feedback de sucesso se quiser
    } catch (err) {
      alert('Erro ao enviar mensagem!');
    }
  };

  return (
    <Dialog
      open={open}
      onClose={onClose}
      maxWidth="sm"
      fullWidth
      PaperProps={{
        sx: {
          background: 'rgba(17, 25, 40, 0.95)',
          backdropFilter: 'blur(20px)',
          borderRadius: 2,
          border: '1px solid rgba(255,255,255,0.1)',
          boxShadow: '0 8px 32px 0 rgba(0,0,0,0.4)'
        }
      }}
    >
      <DialogTitle sx={{ 
        display: 'flex', 
        alignItems: 'center', 
        justifyContent: 'space-between',
        borderBottom: '1px solid rgba(255,255,255,0.1)',
        pb: 2
      }}>
        <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
          <Avatar 
            sx={{ 
              width: 40, 
              height: 40,
              background: 'linear-gradient(135deg, rgb(59, 130, 246) 0%, rgb(37, 99, 235) 100%)'
            }}
          >
            {clinica?.nome?.charAt(0)}
          </Avatar>
          <Box>
            <Typography variant="h6" sx={{ color: 'white' }}>
              {clinica?.nome}
            </Typography>
            <Typography variant="body2" sx={{ color: '#94A3B8' }}>
              {clinica?.especialidade}
            </Typography>
          </Box>
        </Box>
        <IconButton onClick={onClose} sx={{ color: 'rgba(255,255,255,0.5)' }}>
          <CloseIcon />
        </IconButton>
      </DialogTitle>

      <DialogContent sx={{ p: 3 }}>
        <Stack spacing={2}>
          <Box sx={{ 
            p: 2, 
            background: 'rgba(255,255,255,0.05)',
            borderRadius: 2,
            border: '1px solid rgba(255,255,255,0.1)'
          }}>
            <Typography variant="body2" sx={{ color: '#94A3B8' }}>
              Olá, gostaria de agendar uma consulta para {clinica?.especialidade}. 
              Por favor, me informe os horários disponíveis e valores.
            </Typography>
          </Box>

          <TextField
            fullWidth
            multiline
            rows={3}
            value={mensagem}
            onChange={(e) => setMensagem(e.target.value)}
            placeholder="Digite sua mensagem..."
            variant="outlined"
            sx={{
              '& .MuiOutlinedInput-root': {
                color: 'white',
                '& fieldset': {
                  borderColor: 'rgba(255,255,255,0.1)',
                },
                '&:hover fieldset': {
                  borderColor: 'rgba(255,255,255,0.2)',
                },
                '&.Mui-focused fieldset': {
                  borderColor: 'rgba(59, 130, 246, 0.5)',
                }
              }
            }}
          />
        </Stack>
      </DialogContent>

      <DialogActions sx={{ 
        p: 2, 
        borderTop: '1px solid rgba(255,255,255,0.1)',
        justifyContent: 'flex-end'
      }}>
        <Button
          variant="contained"
          endIcon={<SendIcon />}
          onClick={handleEnviarMensagem}
          sx={{
            background: 'linear-gradient(135deg, rgb(29, 78, 216) 0%, rgb(30, 64, 175) 100%)',
            '&:hover': {
              background: 'linear-gradient(135deg, rgb(37, 99, 235) 0%, rgb(29, 78, 216) 100%)',
            }
          }}
        >
          Enviar
        </Button>
      </DialogActions>
    </Dialog>
  );
}
